const branch = $('Tbilisi Pages').first().json.branch;
const operations = $json.operations?.data || $json.data || [];

if (operations.length === 0) return [{ json: { branch, status: 'no_data' } }];

return operations.map(item => {
  const op = item.attributes || item;
  return {
    json: {
      branch,
      operation_type: op.operation_type || op.type || 'unknown',
      operation_id: op.id ? String(op.id) : null,
      description: op.description || '',
      entity_type: op.entity_type || null,
      entity_id: op.entity_id ? String(op.entity_id) : null,
      user_name: op.user_name || null,
      created_at: op.created_at || new Date().toISOString(),
      raw_data: JSON.stringify(op)
    }
  };
});

