const saved = $input.all();
const successCount = saved.filter(s => !s.json.error).length;
const errorCount = saved.filter(s => s.json.error).length;

const byBranch = {};
saved.forEach(item => {
  if (item.json.branch) {
    if (!byBranch[item.json.branch]) byBranch[item.json.branch] = { success: 0, error: 0 };
    if (item.json.error) byBranch[item.json.branch].error++;
    else byBranch[item.json.branch].success++;
  }
});

let message = 'üìú HISTORY PARSER\n';
Object.keys(byBranch).forEach(branch => {
  const stats = byBranch[branch];
  message += `${branch.toUpperCase()}: ${stats.success} ‚úì`;
  if (stats.error > 0) message += ` / ${stats.error} ‚úó`;
  message += '\n';
});
message += `\n–í—Å–µ–≥–æ: ${successCount} / ${saved.length}`;

return [{ json: { message, success: errorCount === 0, saved_count: successCount, error_count: errorCount, by_branch: byBranch } }];
